    "contracts/Store.sol": {
      "content": "// SPDX-License-Identifier: MIT
pragma solidity 0.8.15;

import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "./interfaces/IGPMProtocol.sol";
import "@openzeppelin/contracts-upgradeable/utils/math/SafeMathUpgradeable.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "hardhat/console.sol";

enum Items {
    SEED,
    WATER_DROP,
    COIN,
    FLASK,
    CARD
}

contract Store is Initializable, OwnableUpgradeable {
    using SafeMathUpgradeable for uint256;
    using SafeMathUpgradeable for uint32;
    using SafeMathUpgradeable for uint8;

    event ItemPurchased(uint32 indexed buyer, uint8[] items);

    IGPMProtocol public gpm;

    mapping(uint8 => uint256) public _prices;
    ERC20 public stable;

    mapping(uint32 => uint256) public flaskLastPurchase;
    uint256 public flaskDelay;
    uint256 public flaskShippingPrice;

    mapping(uint32 => uint256) public lastNoticeablePurchase;

    function initialize(address _stable, address _gpm) public initializer {
        __Ownable_init();
        stable = ERC20(_stable);
        flaskDelay = 30 days;
        flaskShippingPrice = 13 * 10 ** 6;

        uint decimalsRatio = 10 ** (stable.decimals() - 1);
        _prices[uint8(Items.SEED)] = uint8(1).mul(decimalsRatio);
        _prices[uint8(Items.WATER_DROP)] = uint8(1).mul(decimalsRatio);
        _prices[uint8(Items.COIN)] = uint8(1).mul(decimalsRatio);
        _prices[uint8(Items.FLASK)] = uint8(3).mul(10 ** stable.decimals());
        _prices[uint8(Items.CARD)] = uint8(5).mul(decimalsRatio);

        gpm = IGPMProtocol(_gpm);
    }

    function setPrice(uint8 _item, uint256 _price) public onlyOwner {
        _prices[_item] = _price;
    }

    function setStable(address _stable) public onlyOwner {
        stable = ERC20(_stable);
    }

    function setFlaskDelay(uint256 _delay) public onlyOwner {
        flaskDelay = _delay;
    }

    function isEligibleToRewards(uint32 _user) public view returns (bool) {
        return getUserEligibilityEnd(_user) >= block.timestamp;
    }

    function getUserEligibilityEnd(uint32 _user) public view returns (uint256) {
        return lastNoticeablePurchase[_user] + 30 days;
    }

    function getAddressEligibilityEnd(
        address _user
    ) public view returns (uint256) {
        uint32 nftId = gpm.nftOfUser(_user);
        return getUserEligibilityEnd(nftId);
    }

    function purchaseItems(uint8[] memory _items) external {
        uint32 nftId = gpm.nftOfUser(msg.sender);
        require(nftId > 0, "Store: You must have a GPM NFT to buy items");
        uint8 flaskQuantity = _items[uint8(Items.FLASK)];
        require(
            flaskQuantity == 0 || flaskQuantity == 6,
            "Store: You must buy 6 flasks at a time"
        );
        if (flaskQuantity > 0) {
            require(
                flaskLastPurchase[nftId] + flaskDelay < block.timestamp,
                "Store: You must wait 30 days before buying more flasks"
            );
            flaskLastPurchase[nftId] = block.timestamp;
        }
        uint256 totalCost = 0;
        for (uint8 i = 0; i < _items.length; i++) {
            uint8 item = _items[i];
            uint256 price = _prices[item];
            totalCost = totalCost.add(price);
        }
        if (totalCost >= 20 * 10 ** 6) {
            lastNoticeablePurchase[nftId] = block.timestamp;
        }
        uint256 totalWithDelivery = totalCost;
        if (flaskQuantity > 0) {
            totalWithDelivery = totalCost.add(flaskShippingPrice);
        }
        require(
            stable.balanceOf(msg.sender) >= totalCost,
            "Store: You don't have enough stable"
        );
        stable.transferFrom(msg.sender, address(gpm), totalWithDelivery);
        gpm.splitStorePurchase(msg.sender, totalCost, _items);
        emit ItemPurchased(nftId, _items);
    }
}
"
